import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, TouchableOpacity, Text, View } from 'react-native';
import logo from '../../assets/Logo.png'
import Button from '../components/Button.js'


const styles = StyleSheet.create({
  page: {
    flex: 1,
    backgroundColor: 'white',
    alignItems: 'center',
  },

  contain: {
    alignItems: 'center',
    position: 'absolute',
    top:'10%',
    width: "20%",
    height: "80%",
    'min-width':'250px',
    'min-height': "400px"
  },
  maintext:{
    font: 'Poppins',
    'font-weight': 'bold',
    color: '#252B63',
    'font-size': '30px',
    position: 'relative',
    'text-align':'center'

  },
  but1:{
    position:'absolute',
    top:'74%',
    width:'276px',
    height:'57px'
  },
  but2:{
    position:'absolute',
    top:'89%',
    width:'276px',
    height:'57px'
  }
});


function fever() {
  return (
    <View style={styles.page}>
    <View style={styles.contain}>
      <Text style={styles.maintext}>Are you Experiencing any fevers or chills?</Text>
    <View style={styles.but1}>
      <Button title="NO"/>
    </View>
    <View style={styles.but2}>
      <Button title="YES"/>
    </View>
      </View>
    </View>
  );
}


export default fever
